export default (function(a,b,c,d,e,f,g,h,i){return {data:{IYKI2A5Llo:{data:{id:2245,attributes:{imdbId:"tt1193138",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTI3MzYxMTA4NF5BMl5BanBnXkFtZTcwMDE4ODg3Mg@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"83\u002F100"}],item_lang:{data:{id:2908,attributes:{title:a,plot:"Ryan Bingham is a corporate downsizing expert whose cherished life on the road is threatened just as he is on the cusp of reaching ten million frequent flyer miles, and just after he's met the frequent-traveller woman of his dreams.",slug:"up-in-the-air"}}},books:{data:[{id:10987,attributes:{title:a,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:e,subtitle:i}},{id:10988,attributes:{title:a,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:e,subtitle:i}},{id:10989,attributes:{title:"Blood Will Out: The True Story of a Murder, a Mystery, and a Masquerade",description:"Describes the author's fifteen-year relationship with eccentric New Yorker Clark Rockefeller, his discovery that Rockefeller was a serial imposter and murderer, and how his old friend's murder trial made him face hard truths about himself.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pBP1AgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2014-03-10",publisher:"W. W. Norton & Company",subtitle:d}},{id:10990,attributes:{title:a,description:"A traveling management consultant, thirty-five-year-old Ryan Bingham spends his life on airplanes and in airports as he travels around the country, pursuing his goal to accumulate one million miles in his frequent flyer account.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RkxJngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2009-10-01",publisher:e,subtitle:d}},{id:10991,attributes:{title:a,description:"Der Motivationstrainer Ryan Bingham hat einen ausgeprägten Spleen: er sammelt Flugbonusmeilen. Sein ganzes privates wie berufliches Leben richtet sich nach Flugkilometern und deren Maximierung. Ob es um die Hochzeit seiner Schwester oder den Konkurs eines Klienten geht, Priorität hat immer der Fluguplan. Unermüdlich hetzt Ryan von Gate zu Gate, bald ist es soweit, die Millionen-Meilen-Grenze rückt in greifbare Nähe. Doch plötzlich gerät sein so sorgsam ausgetüfeltes Meilen-Jagen ins Wanken. Seine Kreditkarte wird aus unerfindlichen Gründen gesperrt, ein Hacker bedient sich seines Meilenkontos, in der Liebe läuft alles quer, seine Schwester verschwindet und auch seine Firma hat kein weiteres Interesse an ihm.",thumbnail:d,authors:[b],firstBook:c,published:"2010-01-01",publisher:d,subtitle:"Roman"}}]}}},meta:{}}},prerenderedAt:1680940933185}}("Up in the Air","Walter Kirn",null,"","Anchor","Ryan Bingham’s job as a Career Transition Counselor–he fires people–has kept him airborne for years. Although he has come to despise his line of work, he has come to love the culture of what he calls “Airworld,” finding contentment within pressurized cabins, anonymous hotel rooms, and a wardrobe of wrinkle-free slacks. With a letter of resignation sitting on his boss’s desk, and the hope of a job with a mysterious consulting firm, Ryan Bingham is agonizingly close to his ultimate goal, his Holy Grail: one million frequent flier miles. But before he achieves this long-desired freedom, conditions begin to deteriorate. With perception, wit, and wisdom, Up in the Air combines brilliant social observation with an acute sense of the psychic costs of our rootless existence, and confirms Walter Kirn as one of the most savvy chroniclers of American life.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QJ93ffsVAHMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2002-08-13","A Novel"))